        function registerPlugin(plugin) {
            plugins.unshift(plugin);
            plugin.init(self);
        }
        /**
         * 撤销插件，通过调用插件的 destroy(self)方法 self为当前grid
         *
         * @method
         */
        function unregisterPlugin(plugin) {
            for (var i = plugins.length; i >= 0; i--) {
                if (plugins[i] === plugin) {
                    if (plugins[i].destroy) {
                        plugins[i].destroy();
                    }
                    plugins.splice(i, 1);
                    break;
                }
            }
        }
